import React from "react";
import "./FaqUsingState.css";
import { questios } from "../question";

const FaqUsingState = () => {
  return (
    <div>
      <h1>Frequently Asked Questions (FAQs)</h1>
      <div className="faqouter">
        {questios.map((faqItems, i) => {
          return (
            <>
              <div className="faqItems">
                <h2>{faqItems}</h2>
                <p>
                  Lorem, ipsum dolor sit amet consectetur adipisicing elit.
                  Numquam rem, cum sint eum tenetur voluptatibus, corrupti
                  incidunt quia ipsa dolorem sed. Expedita consequatur
                  recusandae eum adipisci itaque voluptatum saepe tempora
                  asperiores? Velit minima iste blanditiis vero dolore dolor
                  nisi quibusdam. In deleniti similique ducimus, provident
                  architecto necessitatibus sed ratione assumenda quaerat
                  exercitationem facere at officia, molestias libero. Sapiente,
                  quidem numquam blanditiis animi
                </p>
              </div>
              ;
            </>
          );
        })}
      </div>
    </div>
  );
};

export default FaqUsingState;
